proxy-groups:
  #  Top-level selector 
  - name: "PROXY-BEST"
    type: select
    proxies:
      - "SCEN-OPEN"
      - "SCEN-CDN"
      - "UDP-BEST"
      - "FAST-ALL"
      - "LB-ALL"
      - "MANUAL"
      - DIRECT

  #  Scenario groups 
  - name: "SCEN-OPEN"
    type: fallback
    url: http://www.gstatic.com/generate_204
    interval: 300
    lazy: true
    proxies:
      - "LB-ALL"
      - "FAST-ALL"

  - name: "SCEN-CDN"
    type: fallback
    url: http://cp.cloudflare.com/generate_204
    interval: 300
    lazy: true
    proxies:
      - "LB-CDN"
      - "FAST-CDN"

